import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <div className='bg-[#71AC57] flex justify-between items-center h-24  mx-auto px-4 text-white'>
        <img className="w-[270px] h-[90px]" src="./Recrash.png" alt="" />
        <ul className='hidden md:flex'>
          <li className='p-4 text-3xl font-bold cursor-pointer hover: text-[]'>Home</li>
          <li className='p-4 text-3xl font-bold cursor-pointer'>Map</li>
          <li className='p-4 text-3xl font-bold cursor-pointer'>About</li>
        </ul>
        </div>
     );
}
 
export default Navbar;
